import React from 'react';
import CustomCanvas from './CustomCanvas';

/**
 * Draws an Arc using Canvas to show feedback to the user
 */
class ArcLoader extends React.Component {
	/**
	 * Renders HTML and uses CustomCanvas component
	 * Can have either a progress or a completed state
	 * Shows a number in the center indicating the percentage of Arc drawn
	 */
	render() {
		// Default className of the main container
		var containerClassNames = ['arc-loader'];

		// append "completed" to the default className
		// if completed
		if(this.props.completed) {
			containerClassNames.push('completed');
		}

		return (
			<div className={containerClassNames.join(' ')}>
				<div className="row">
					<div className="col-lg-12">
						<CustomCanvas width={this.props.width} height={this.props.height} arcSpecs={this.props.specs} />
					</div>
				</div>
				<div className="al-progress-label al-label">
					<div className="row">
						<div className="col-lg-12">{this.props.percentageCompleted}<span>%</span></div>
					</div>
				</div>
				<div className="al-completed-label al-label">
					<div className="row">
						<div className="col-lg-12">&#10003;</div>
					</div>
				</div>
			</div>
		);
	}
}

export default ArcLoader;

import React from 'react';

/**
 * Abstracts HTML Canvas container as a React Component
 */
class CustomCanvas extends React.Component {
	/**
	 * Paint when component mounts
	 */
	componentDidMount() {
		this.paint();
	}

	/**
	 * Paint when component's properties are updated
	 */
	componentDidUpdate() {
		this.paint();
	}

	/**
	 * Draws in Canvas based on props
	 * Will draw an Arc if 'arcSpecs' is provided in props
	 */
	paint() {
		if(typeof this.props.arcSpecs !== 'undefined') {
			this.paintArc(this._canvas.getContext('2d'), this.props.arcSpecs);
		}
	}

	/**
	 * Draws an Arc in Canvas
	 * @param {object} [name="context"] - '2d' context of Canvas
	 * @param {object} [name="specs"] - Standard specifications to draw an Arc (http://www.w3schools.com/tags/canvas_arc.asp)
	 */
	paintArc(context, specs) {
		// Arc
		context.beginPath();
		context.arc(
			specs.x,
			specs.y,
			specs.radius,
			specs.startAngle,
			specs.endAngle,
			specs.counterClockwise
		);

		// line
		context.lineWidth = specs.lineWidth;
		context.strokeStyle = specs.strokeStyle;context.stroke();
		context.closePath();
	}

	/**
	 * Renders a native Canvas element
	 */
	render() {
		return (<canvas width={this.props.width} height={this.props.height} ref={(c) => this._canvas = c} />);
	}
}

export default CustomCanvas;

import React from 'react';

/**
 * Abstracts asynchronous file upload functionality
 */
class FileUploader extends React.Component {
	/**
	 * Sets the state & binds member functions with the current context
	 * @param {Object} props
	 * @param {function} props.onProgress 	- callback when upload is in progress and there is a change in the state
	 * @param {function} props.onComplete 	- callback when upload is completed
	 * @param {function} props.onStop 		- callback when upload is stopped manually
	 */
	constructor(props) {
		super(props);
		this.state = {
			uploading: false,
			percentage: 0,
			completed: false,
			interval: null
		}

		// Apparently React with ES6 doesn't bind "this" to
		// custom methods (https://github.com/goatslacker/alt/issues/283)
		this.startUpload = this.startUpload.bind(this);
		this.stopUpload = this.stopUpload.bind(this);
		this.clearInterval = this.clearInterval.bind(this);
	}

	/**
	 * Starts an interval if not already uploading
	 * Sets interval to state
	 * Sets uploading (true) to state
	 */
	startUpload() {
		// Already in progress (ignore the clicks)
		if(this.state.uploading) {
			return;
		}

		// Start interval and set uploading to true
		this.setState({
			interval: setInterval(this.upload, 5),
			uploading: true
		});
	}

	/**
	 * Updates the percentage of completion
	 * Invokes callbacks provided in props
	 */
	upload() {
		this.updatePercentage(_.random(0.0005, 0.0010)); // Increment the percentage randomly to simulate network lag
		this.invokeCallbacks(this.state.percentage, this.state.percentage); // Invoke callbacks
	}


	updatePercentage(by) {
		this.state.percentage += by;
	}

	invokeCallbacks(percentage, payload) {
		// If defined, invoke the callback required on progress
		if(typeof this.props.onProgress !== 'undefined') {
			this.props.onProgress(payload);
		}

		// Simulation complete, end the animation
		if(percentage > 1) {
			this.clearInterval(); // clear the interval

			// If defined, invoke the callback required on complete
			if(typeof this.props.onComplete !== 'undefined') {
				this.props.onComplete(null);
			}
		}
	}

	stopUpload() {
		this.clearInterval();

		if(this.props.onStop) {
			this.props.onStop(null);
		}
	}

	clearInterval() {
		clearInterval(this.state.interval);
		this.setState({
			interval: null,
			uploading: false
		});
	}

	render() {
		return (
			<div className="file-uploader">
				<div className="row">
					<div className="col-lg-12">
						<div className="pull-right">
							<button title="play" onClick={this.startUpload}>&#9658;</button>
							<button title="pause" onClick={this.stopUpload}>&#9724;</button>
						</div>
						<div class="clearfix"></div>
					</div>
				</div>
			</div>
		);
	}
}

export default FileUploader;

import React from 'react';
import ArcLoader from './ArcLoader';
import FileUploader from './FileUploader';

class UploadForm extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			uploading: false,
			percentageCompleted: 0,
			completed: false,
			arcSpecs: {
				x: 95,
				y: 110,
				radius: 70,
				startAngle: 1.5 * Math.PI,
				endAngle: 1.5 * Math.PI,
				counterClockwise: false,
				lineWidth: 5,
				strokeStyle: '#e1e1e1'
			}
		}


		// Apparently React with ES6 doesn't bind "this" to
		// custom methods (https://github.com/goatslacker/alt/issues/283)
		this.showProgress = this.showProgress.bind(this);
		this.completeUpload = this.completeUpload.bind(this);
	}

	showProgress(percentage) {
		// update state
		this.setState({
			uploading: true,
			percentageCompleted: parseInt(percentage*100),
			arcSpecs: _.extend(this.state.arcSpecs, {
				endAngle: mathUtils.arc.percentageToEndAngle(percentage)
			})
		})
	}

	completeUpload(filename) {
		this.setState({
			completed: true,
			uploading: false
		})
	}

	showError(filename) {}

	render() {
		return (
			<div className="upload-form-container">
				<div className="row">
					<div className="col-lg-12">
						<ArcLoader
							percentageCompleted={this.state.percentageCompleted}
							specs={this.state.arcSpecs}
							width="200"
							height="210"
							completed={this.state.completed}
							/>
					</div>
				</div>
				<div className="row">
					<div className="col-lg-6">
						<p className="ufc-info-label">Press play to emulate a file upload</p>
					</div>
					<div className="col-lg-6">
						<FileUploader
							onProgress={this.showProgress}
							onError={this.showError}
							onComplete={this.completeUpload}
							/>
					</div>
				</div>
			</div>
		);
	}
}

var mathUtils = {
	arc: {
		percentageToEndAngle: (percentage) => {
			return 2 * Math.PI * percentage - (Math.PI / 2);
		}
	}
};

export default UploadForm;
